import React from 'react';

function Dashboard() {
  return (
    <div className="dashboard">
      <h1>Panel Principal</h1>
      <p>Bienvenido a la aplicación de integración de horarios con Google Calendar.</p>
      {/* Aquí se pueden añadir los componentes de eventos próximos, notificaciones, etc. */}
    </div>
  );
}

export default Dashboard;
